import React from "react";
import UserService from "../api/UserService";


class UserComponent extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            users:[]
        }
    };

    componentDidMount() {
        UserService.loginUser().then((response) => {
        this.setState=({users:response.data})
        });
        
    }

    render() {
        return (
            <div>
                    <h1 className="text-center">User List</h1>
                    <table className="table">
                        <thead>
                            <tr>
                                <td> User ID</td>
                                <td>User First name</td>
                                <td> User Last name</td>
                                <td>User Password</td>
                                <td> User Email</td>
                                <td>User dob</td>
                                <td>User Address</td>
                                <td> User Age</td>
                                <td>UserRole</td>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.users.map(user =>
                                    <tr key={user.id}>
                                        
                                        <td>{user.id}</td>
                                        <td>{user.firstName}</td>
                                        <td>{user.lastName}</td>
                                        <td>{user.email}</td>
                                        <td>{user.password}</td>
                                    </tr>)
                            }
                            console.log(user.id)
                        </tbody>
                    </table>
            </div>
        )
    }

}

export default UserComponent;
